const header = () => {
    return (
        <div className='bg-gray-200'>
            <h1>

            <igm className='h-24 mx-auto py-4'
            src='/logo.png'
            alt='' 
            height='60'
            />
        
            <div className='bg-gray-500'></div>
            
            </h1>

        </div>
    )
}

export default Header;
